    <div className="flex flex-col items-center justify-center h-screen lg:min-h-screen">
      <div className="flex justify-center justify-start space-x-8 mb-4">
        <img className="FClogo w-20 h20 md:w-40 md:h-20 object-contain" src={FClogo} alt="FC Logo" />
        <img className="Zlogo w-20 h-20 md:w-40 md:h-20 object-contain" src={Zlogo} alt="Z Logo" />
      </div>
      
      <p className="lg:text-4xl text-2xl mb-5 text-center">Welcome Folks, We are coming soon..</p>
      <p className="text-center text-gray-300">The courses will start soon once the minimum number of participants are reached.</p>
      <p className="text-center text-gray-300 mb-4 ">Please make sure you are signed in to get notified.</p>
      
      <button className=" text-white font-bold  px-4 py-1 rounded hover:bg-red-600 transition">Sign Up</button>
    </div>

  )
}

export default Tempwelcomepage
